import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "./App.css";
import "antd/dist/antd.css";
import Header from "./components/Header";
import Dashboard from "./pages/Dashboard";

function App() {
  return (
    <div className="App">
      <Router>
        <Header />
        <Dashboard />
      </Router>
    </div>
  );
}

export default App;
